fered. \n\n\n### DataFrames\n**DataFrames** and **Spark SQL** are very flexible and bring built-in optimization also for dynamic languages like Python and R. Beside this, it allows to combine both *declarative* and *functional* way of working with structured data.\nIt's regarded to be most stable and flexible API.\n\n<img src='https://databricks.com/wp-content/uploads/2015/02/Screen-Shot-2015-02-16-at-9.46.39-AM-1024x457.png' style='width:400px'>\n\n\n### Datasets\n**Datasets** unify the best from both worlds: **type safety** from **RDDs** and **built-in optimization** available for **DataFrames**. \nBut it is in experimental phase and can be used with Scala, Java and Python. DSs allow even further optimizations (memory compaction + faster serialization using encoders).\nDataSets are not yet mature, but it is expected, that it will quickly become a common way to work with structured data, and Spark plans to converge the APIs even further.\n\nHere some benchmarks of DataSets:\n\n<img src='https://databricks.com/wp-content/uploads/2016/01/Distributed-Wordcount-Chart-1024x371.png' style='width:400px'>\n<img src='https://databricks.com/wp-content/uploads/2016/01/Memory-Usage-when-Caching-Chart-1024x359.png?noresize' style='width:400px'>\n<img src='https://databricks.com/wp-content/uploads/2016/01/Serialization-Deserialization-Performance-Chart-1024x364.png?noresize' style='width:400px'>\n","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":1.461156105272E12,"submitTime":1.461156105272E12,"finishTime":1.461156105304E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"dieter.kling@comsysto.com","commandTitle":"","showCommandTitle":fals
